// author kiran
import React from 'react';
import Project from './Project';
import NavBar from './NavBar';
import Language  from './Language';
import Experience from './Experience';
import Contact from './Contact';
import $ from 'jquery';
import Download from './Download';
import About from './About';
import Fade from 'react-reveal/Fade';
import Gallery from './Gallery';

export default function Portfolio() {

    $('#experience , #project , #language , #download , #contact ').click(function(){
        $(document).scrollTop(20) 
    });

    return (
        <React.Fragment> 
            {/* Header starts*/}
                {/* Navbar section */}
                <section>
                    <NavBar />
                </section>
             {/* Header ends*/}

            {/* Body starts*/}
                <div className="container">
                    {/* About section */}
                    <section  id="About" > 
                        <About />
                    </section>
                    {/* Project section */}
                    <Fade top>
                        <section  id="project"> 
                            <Project />
                        </section>
                    </Fade>
                    {/* Experience section */}
                    <section id="experience">
                        <Experience />
                    </section>
                    {/* Language known section */}
                    <section id="language" >
                        <Language />
                    </section>
                     {/* Gallery section */}
                     <section id="download">
                        <Gallery />
                    </section>
                    {/* Download section */}
                    <section id="download">
                        <Download />
                    </section>
                </div>
            {/* Body ends */}

            {/* Footer */}
                <section id="contact">
                    <Contact />
                </section>
            {/* Footer ends */}

        </React.Fragment>
    )
}
